import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for products to load and find the first product
    await page.waitForSelector('.product-card', { timeout: 10000 });

    // Get product details before adding to cart
    const productTitle = await page.$eval('.product-card:first-child .product-title', el => el.textContent.trim());
    const productPrice = await page.$eval('.product-card:first-child .product-price', el => el.textContent.trim());

    // Take screenshot before adding to cart
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_product_found.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_product_found.png'));

    // Click the "Add to Cart" button for the first product
    await page.click('.product-card:first-child .add-to-cart');

    // Wait for cart to update (check if cart count increases)
    await page.waitForFunction(() => {
      const cartCount = document.querySelector('#cartCount');
      return cartCount && parseInt(cartCount.textContent) > 0;
    }, { timeout: 5000 });

    // Take screenshot after adding to cart
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_added_to_cart.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_added_to_cart.png'));

    // Verify cart count increased
    const cartCount = await page.$eval('#cartCount', el => parseInt(el.textContent));

    return {
      success: true,
      action: "Added first product to cart successfully",
      extractedData: {
        productTitle,
        productPrice,
        cartCount
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to add first product to cart",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
